When building complex apps with Dioxus, the best approach is to start by placing your state and an UI all within a single component. Once your component has passed a few hundred lines, then it might be worth refactoring it into a few smaller components. Here, we're now challenged with how to share state between these various components. Let's say we refactored our component to separate an input and a display. fn app(cx: Scope) -> Element { cx.render(rsx!{ Title {} Input {} })
} Whenever a value is inputted in our Input component, we need to somehow propagate those changes into the Title component. A quick-and-dirty solution - which works for many apps - is to simply share a UseState between the two components. fn app(cx: Scope) -> Element { let text = use_state(&cx, || "default".to_string()); cx.render(rsx!{ Title { text: text.clone() } Input { text: text.clone() } })
} Note: since we Cloned our text UseState handle, both Title and Input will be memoized. Here, we've "lifted" state out of our Input component and brought it up to the closest shared ancestor. In our input component, we can directly use this UseState handle as if it had been defined locally: #[inline_props]
fn Input(cx: Scope, text: UseState<String>) -> Element { cx.render(rsx!{ input { oninput: move |evt| text.set(evt.value.clone()) } })
} Similarly, our Title component would be straightforward: #[inline_props]
fn Title(cx: Scope, text: UseState<String>) -> Element { cx.render(rsx!{ h1 { "{text}" } })
} For more complicated use cases, we can take advantage of the EventHandler coercion talked about before to pass in any callback. Recall that fields on components that start with "on" are automatically "upgraded" into an EventHandler at the call site. This lets us abstract over the exact type of state being used to store the data. For the Input component, we would simply add a new oninput field: #[inline_props]
fn Input<'a>(cx: Scope<'a>, oninput: EventHandler<'a, String>) -> Element { cx.render(rsx!{ input { oninput: move |evt| oninput.call(evt.value.clone()), } })
} For our Title component, we could also abstract it to take any &str: #[inline_props]
fn Title<'a>(cx: Scope<'a>, text: &'a str) -> Element { cx.render(rsx!{ h1 { "{text}" } })
}

