As your app grows and grows, you might need to start pulling in global state to avoid prop drilling. This tends to solve a lot of problems, but generates even more. For instance, let's say we built a beautiful Title component. Instead of passing props in, we instead are using a use_read hook from Fermi. fn Title(cx: Scope) -> Element { let title = use_read(&cx, TITLE); cx.render(rsx!{ h1 { "{title}" } })
} This is great - all is well in the world. We get precise updates, automatic memoization, and a solid abstraction. But, what happens when we want to reuse this component in another project? This component is now deeply intertwined with our global state - which might not be the same in another app. In this case, we want to "lift" our global state out of "view" components. With lifting, our individual components at "leaf" position of our VirtualDom are "pure", making them easily reusable, testable, and deterministic. To enable our title component to be used across apps, we want to lift our atoms upwards and out of the Title component. We would organize a bunch of other components in this section of the app to share some of the same state. fn DocsiteTitlesection(cx: Scope) { // Use our global state in a wrapper component let title = use_read(&cx, TITLE); let subtitle = use_read(&cx, SUBTITLE); let username = use_read(&cx, USERNAME); let points = use_read(&cx, POINTS); // and then pass our global state in from the outside cx.render(rsx!{ Title { title: title.clone(), subtitle: subtitle.clone() } User { username: username.clone(), points: points.clone() } })
} This particular wrapper component unfortunately cannot be reused across apps. However, because it simply wraps other real elements, it doesn't have to. We are free to reuse our TitleBar and UserBar components across apps with ease. We also know that this particular component is plenty performant because the wrapper doesn't have any props and is always memoized. The only times this component re-renders is when any of the atoms change. This is the beauty of Dioxus - we always know where our components are likely to be re-rendered. Our wrapper components can easily prevent any large re-renders by simply memoizing their components. This system might not be as elegant or precise as signal systems found in libraries like Sycamore or SolidJS, but it is quite ergonomic.

