A strategy for handling cascaded errors in larger apps is through signaling an error using global state. This particular pattern involves creating an "error" context, and then setting it wherever relevant. This particular method is not as "sophisticated" as React's error boundary, but it is more fitting for Rust. To get started, consider using a built-in hook like use_context and use_context_provider or Fermi. Of course, it's pretty easy to roll your own hook too. At the "top" of our architecture, we're going to want to explicitly declare a value that could be an error. enum InputError { None, TooLong, TooShort,
} static INPUT_ERROR: Atom<InputError> = |_| InputError::None; Then, in our top level component, we want to explicitly handle the possible error state for this part of the tree. fn TopLevel(cx: Scope) -> Element { let error = use_read(&cx, INPUT_ERROR); match error { TooLong => return cx.render(rsx!{ "FAILED: Too long!" }), TooShort => return cx.render(rsx!{ "FAILED: Too Short!" }), _ => {} }
} Now, whenever a downstream component has an error in its actions, it can simply just set its own error state: fn Commandline(cx: Scope) -> Element { let set_error = use_set(&cx, INPUT_ERROR); cx.render(rsx!{ input { oninput: move |evt| { if evt.value.len() > 20 { set_error(InputError::TooLong); } } } })
} This approach to error handling is best in apps that have "well defined" error states. Consider using a crate like thiserror or anyhow to simplify the generation of the error types. This pattern is widely popular in many contexts and is particularly helpful whenever your code generates a non-recoverable error. You can gracefully capture these "global" error states without panicking or mucking up state.

