To add fermi to your project, simply add the "fermi" feature to your Dioxus dependency. [dependencies]
dioxus = { version = "0.2", features = ["desktop", "fermi"] } Fermi is built on the concept of "atoms" of global state. Instead of bundling all our state together in a single mega struct, we actually chose to implement it piece-by-piece with functions. Each piece of global state in your app is represented by an "atom." static TITLE: Atom<String> = |_| "Defualt Title".to_string(); This atom can be then used the with the use_atom hook as a drop-in replacement for use_state. static TITLE: Atom<String> = |_| "Defualt Title".to_string(); fn Title(cx: Scope) -> Element { let title = use_atom(&cx, TITLE); cx.render(rsx!{ button { onclick: move |_| title.set("new title".to_string()) } })
} However, Fermi really becomes useful when we want to share the value between two different components. static TITLE: Atom<String> = |_| "Defualt Title".to_string(); fn TitleBar(cx: Scope) -> Element { let title = use_atom(&cx, TITLE); rsx!{cx, button { onclick: move |_| title.set("titlebar title".to_string()) } }
} fn TitleCard(cx: Scope) -> Element { let title = use_atom(&cx, TITLE); rsx!{cx, button { onclick: move |_| title.set("title card".to_string()) } }
} These two components can get and set the same value!

