Fermi gets really powerful when used to manage collections of data. Under the hood, Fermi uses immutable collections and tracks reads and writes of individual keys. This makes it easy to implement things like lists and infinite posts with little performance penalty. It also makes it really easy to refactor our app and add new fields. static NAMES: AtomRef<Uuid, String> = |builder| {};
static CHECKED: AtomRef<Uuid, bool> = |builder| {};
static CREATED: AtomRef<Uuid, Instant> = |builder| {}; To use these collections: #[inline_props]
fn Todo(cx: Scope, id: Uuid) -> Element { let name = use_atom(&cx, NAMES.select(id)); let checked = use_atom(&cx, CHECKED.select(id)); let created = use_atom(&cx, CREATED.select(id)); // or let (name, checked, created) = use_atom(&cx, (NAMES, CHECKED, CREATED).select(id));
} This particular pattern might seem strange at first - "why isn't all of our state under one struct?" - but eventually shows its worth when dealing with large amounts of data. By composing collections together, we can get get the perks of the Entity-Component-System architecture in our Dioxus apps. Performance is quite predictable here and easy to trace.

