Unlike other routers in the Rust ecosystem, our router is built declaratively. This makes it possible to compose our app layout simply by arranging components. rsx!{ Router { Route { to: "/home", Home {} } Route { to: "/blog", Blog {} } }
} Whenever we visit this app, we will get either the Home component or the Blog component rendered depending on which route we enter at. If neither of these routes match the current location, then nothing will render. We can fix this one of two ways: A fallback 404 page rsx!{ Router { Route { to: "/home", Home {} } Route { to: "/blog", Blog {} } Route { to: "", NotFound {} } }
} Redirect 404 to home rsx!{ Router { Route { to: "/home", Home {} } Route { to: "/blog", Blog {} } Redirect { from: "", to: "/home" } }
}

