}); To make this a little bit easier, Dioxus exports the to_owned! macro which will create a binding as shown above, which can be quite helpful when dealing with many values. cx.spawn({ to_owned![count, age, name, description, etc]; async move { tokio::time::sleep(Duration::from_millis(1000)).await; count += 1; }
