The basic setup for coroutines is the use_coroutine hook. Most coroutines we write will be polling loops using async/await. fn app(cx: Scope) -> Element { let ws: &UseCoroutine<()> = use_coroutine(&cx, |rx| async move { // Connect to some sort of service let mut conn = connect_to_ws_server().await; // Wait for data on the service while let Some(msg) = conn.next().await { // handle messages } });
} For many services, a simple async loop will handle the majority of use cases. However, if we want to temporarily disable the coroutine, we can "pause" it using the pause method, and "resume" it using the resume method: let sync: &UseCoroutine<()> = use_coroutine(&cx, |rx| async move { // code for syncing
}); if sync.is_running() { cx.render(rsx!{ button { onclick: move |_| sync.pause(), "Disable syncing" } })
} else { cx.render(rsx!{ button { onclick: move |_| sync.resume(), "Enable syncing" } })
} This pattern is where coroutines are extremely useful - instead of writing all the complicated logic for pausing our async tasks like we would with JavaScript promises, the Rust model allows us to just not poll our future.

