You might've noticed the use_coroutine closure takes an argument called rx. What is that? Well, a common pattern in complex apps is to handle a bunch of async code at once. With libraries like Redux Toolkit, managing multiple promises at once can be challenging and a common source of bugs. With Coroutines, we have the opportunity to centralize our async logic. The rx parameter is an Unbounded Channel for code external to the coroutine to send data into the coroutine. Instead of looping on an external service, we can loop on the channel itself, processing messages from within our app without needing to spawn a new future. To send data into the coroutine, we would call "send" on the handle. enum ProfileUpdate { SetUsername(String), SetAge(i32)
} let profile = use_coroutine(&cx, |mut rx: UnboundedReciver<ProfileUpdate>| async move { let mut server = connect_to_server().await; while let Ok(msg) = rx.next().await { match msg { ProfileUpdate::SetUsername(name) => server.update_username(name).await, ProfileUpdate::SetAge(age) => server.update_age(age).await, } }
}); cx.render(rsx!{ button { onclick: move |_| profile.send(ProfileUpdate::SetUsername("Bob".to_string())), "Update username" }
}) For sufficiently complex apps, we could build a bunch of different useful "services" that loop on channels to update the app. let profile = use_coroutine(&cx, profile_service);
let editor = use_coroutine(&cx, editor_service);
let sync = use_coroutine(&cx, sync_service); async fn profile_service(rx: UnboundedReceiver<ProfileCommand>) { // do stuff
} async fn sync_service(rx: UnboundedReceiver<SyncCommand>) { // do stuff
} async fn editor_service(rx: UnboundedReceiver<EditorCommand>) { // do stuff
} We can combine coroutines with Fermi to emulate Redux Toolkit's Thunk system with much less headache. This lets us store all of our app's state within a task and then simply update the "view" values stored in Atoms. It cannot be understated how powerful this technique is: we get all the perks of native Rust tasks with the optimizations and ergonomics of global state. This means your actual state does not need to be tied up in a system like Fermi or Redux - the only Atoms that need to exist are those that are used to drive the display/UI. static USERNAME: Atom<String> = |_| "default".to_string(); fn app(cx: Scope) -> Element { let atoms = use_atom_root(&cx); use_coroutine(&cx, |rx| sync_service(rx, atoms.clone())); cx.render(rsx!{ Banner {} })
} fn Banner(cx: Scope) -> Element { let username = use_read(&cx, USERNAME); cx.render(rsx!{ h1 { "Welcome back, {username}" } })
} Now, in our sync service, we can structure our state however we want. We only need to update the view values when ready. enum SyncAction { SetUsername(String),
} async fn sync_service(mut rx: UnboundedReceiver<SyncAction>, atoms: AtomRoot) { let username = atoms.write(USERNAME); let errors = atoms.write(ERRORS); while let Ok(msg) = rx.next().await { match msg { SyncAction::SetUsername(name) => { if set_name_on_server(&name).await.is_ok() { username.set(name); } else { errors.make_mut().push("SetUsernameFailed"); } } } }
}

