In some components, you might want to render different markup given some condition. The typical example for conditional rendering is showing a "Log In" screen for users who aren't logged into your app. To break down this condition, we can consider two states: Logged in: show the app Logged out: show the login screen Using the knowledge from the previous section on components, we'll start by making the app's props: #[derive(Props, PartialEq)]
struct AppProps { logged_in: bool
} Now that we have a "logged_in" flag accessible in our props, we can render two different screens: fn App(cx: Scope<AppProps>) -> Element { if cx.props.logged_in { cx.render(rsx!{ DashboardScreen {} }) } else { cx.render(rsx!{ LoginScreen {} }) }
