struct VoteButtonProps { score: i32
} fn VoteButton(cx: Scope<VoteButtonProps>) -> Element { cx.render(rsx!{ div { div { "+" } div { "{cx.props.score}"} div { "-" } } })
} Now, we can use the VoteButton Component like we would use a regular HTML element: fn main() { dioxus::desktop::launch(App);
} fn App(cx: Scope) -> Element { cx.render(rsx! ( VoteButton { score: 42 } ))
} And we can see that the Component indeed gets rendered: Screenshot of running app. Text: "+ \ 42 \ -" The simplest Owned Props you can have is () - or no value at all. This is what the App Component takes as props. Scope accepts a generic for the Props which defaults to (). // this scope
