Scope Borrowed Props Owning props works well if your props are easy to copy around - like a single number. But what if we need to pass a larger data type, like a String from an App Component to a TitleCard subcomponent? A naive solution might be to .clone() the String, creating a copy of it for the subcomponent – but this would be inefficient, especially for larger Strings. Rust allows for something more efficient – borrowing the String as a &str. Instead of creating a copy, this will give us a reference to the original String – this is what Borrowed Props are for! However, if we create a reference a String, Rust will require us to show that the String will not go away while we're using the reference. Otherwise, if we referenced something that doesn't exist, Bad Things could happen. To prevent this, Rust asks us to define a lifetime for the reference: #[derive(Props)]
struct TitleCardProps<'a> { title: &'a str,
} fn TitleCard<'a>(cx: Scope<'a, TitleCardProps<'a>>) -> Element { cx.render(rsx!{ h1 { "{cx.props.title}" } })
} This lifetime 'a tells the compiler that as long as title exists, the String it was created from must also exist. Dioxus will happily accept such a component – we can now render it alongside our VoteButton! fn App(cx: Scope) -> Element { // For the sake of an example, we create the &str here. // But you might as well borrow it from an owned String type. let hello = "Hello Dioxus!"; cx.render(rsx! ( VoteButton { score: 42 }, TitleCard { title: hello } ))
