Dioxus is one of a handful of Rust libraries that provide a "Reactive Programming Model". The term "Reactive programming" is a classification of programming paradigm - much like functional or imperative programming. This is a very important distinction since it affects how we think about our code. Reactive programming is a programming model concerned with deriving computations from asynchronous data flow. Most reactive programs are comprised of datasources, intermediate computations, and a final result. We consider the rendered GUI to be the final result of our Dioxus apps. The datasources for our apps include local and global state. For example, the model presented in the figure below is comprised of two data sources: time and a constant. These values are passed through our computation graph to achieve a final result: g. Reactive Model Whenever our seconds variable changes, we will then reevaluate the computation for t. Because g relies on t, we will also reevaluate its computation too. Notice that we would've reevaluated the computation for g even if t didn't change because seconds is used to calculate g. However, if we somehow changed our constant from 1 to 2, then we need to reevaluate t. If, for whatever reason, this change did not affect the result of t, then we wouldn't try to reevaluate g. In Reactive Programming, we don't think about whether or not we should reevaluate t or g; instead, we simply provide functions of computation and let the framework figure out the rest for us. In Rust, our reactive app would look something like: fn compute_g(t: i32, seconds: i32) -> bool { t > seconds
} fn compute_t(constant: i32, seconds: i32) -> i32 { constant + seconds
} fn compute_graph(constant: i32, seconds: i32) -> bool { let t = compute_t(constant, seconds); let g = compute_g(t, seconds); g
}

