The Dioxus VirtualDom provides us a framework for reactive programming. When we build apps with dioxus, we need to provide our own datasources. This can be either initial props or some values fetched from the network. We then pass this data through our app into components through properties. If we represented the reactive graph presented above in Dioxus, it would look very similar: // Declare a component that holds our datasources and calculates `g`
fn RenderGraph(cx: Scope) -> Element { let seconds = use_datasource(SECONDS); let constant = use_state(&cx, || 1); cx.render(rsx!( RenderG { seconds: seconds } RenderT { seconds: seconds, constant: constant } ))
} // "calculate" g by rendering `t` and `seconds`
#[inline_props]
fn RenderG(cx: Scope, seconds: i32) -> Element { cx.render(rsx!{ "There are {seconds} seconds remaining..." })
} // calculate and render `t` in its own component
#[inline_props]
fn RenderT(cx: Scope, seconds: i32, constant: i32) -> Element { let res = seconds + constant; cx.render(rsx!{ "{res}" })
} With this app, we've defined three components. Our top-level component provides our datasources (the hooks), computation nodes (child components), and a final value (what's "rendered"). Now, whenever the constant changes, our RenderT component will be re-rendered. However, if seconds doesn't change, then we don't need to re-render RenderG because the input is the same. If seconds does change, then both RenderG and RenderT will be reevaluated. Dioxus is "Reactive" because it provides this framework for us. All we need to do is write our own tiny units of computation and Dioxus figures out which components need to be reevaluated automatically. These extra checks and algorithms add some overhead, which is why you see projects like Sycamore and SolidJS eliminating them altogether. Dioxus is really fast, so we're willing to exchange the added overhead for improved developer experience.

