Dioxus will automatically figure out how to regenerate parts of our app when datasources change. But how exactly can we update our data sources? In Dioxus there are two datasources: Local state in use_hook and all other hooks Global state through provide_context. Technically, the root props of the VirtualDom are a third datasource, but since we cannot modify them, they are not worth talking about. Local State For local state in hooks, Dioxus gives us the use_hook method which returns an &mut T without any requirements. This means raw hook values are not tracked by Dioxus. In fact, we could write a component that modifies a hook value directly: fn app(cx: Scope) -> Element { let mut count = cx.use_hook(|_| 0); cx.render(rsx!{ button { onclick: move |_| *count += 1, "Count: {count}" } })
} However, when this value is written to, the component does not know to be reevaluated. We must explicitly tell Dioxus that this component is "dirty" and needs to be re-rendered. This is done through the cx.needs_update method: button { onclick: move |_| { *count += 1; cx.needs_update(); }, "Count: {count}"
} Now, whenever we click the button, the value will change and the component will be re-rendered. Re-rendering is when Dioxus calls your function component again . Component functions will be called over and over throughout their lifetime, so they should be mostly side-effect free. Understand this! Your component functions will be called ("rendered" in our lingo) for as long as the component is present in the tree. A single component will be called multiple times, modifying its own internal state or rendering new nodes with new values from its properties. App-Global State With the provide_context and consume_context methods on Scope, we can share values to descendants without having to pass values through component props. This has the side-effect of making our datasources less obvious from a high-level perspective, but it makes our components more modular within the same codebase. To make app-global state easier to reason about, Dioxus makes all values provided through provide_context immutable. This means any library built on top of provide_context needs to use interior mutability to modify shared global state. In these cases, App-Global state needs to manually track which components need to be re-generated. To regenerate any component in your app, you can get a handle to the Dioxus' internal scheduler through schedule_update_any: let force_render = cx.schedule_update_any(); // force a render of the root component
force_render(ScopeId(0));

