] This is why hooks called out of order will fail - if we try to downcast a Hook<String> to Hook<u32>, Dioxus has no choice but to panic. We do provide a try_use_hook but you should never need that in practice. This pattern might seem strange at first, but it can be a significant upgrade over structs as blobs of state, which tend to be difficult to use in Rust given the ownership system .

