cx.use_hook(|_| { // do something with name here
}) ❌ Uses in conditionals // ❌ don't call use_ in conditionals!
if do_thing { let name = use_state(&cx, || 0);
} // ✅ instead, *always* call use_state but leave your logic
let name = use_state(&cx, || 0);
if do_thing { // do thing with name here
