However, most hooks you'll interact with don't return an &mut T since this is not very useful in a real-world situation. Consider when we try to pass our &mut String into two different handlers: fn example(cx: Scope) -> Element { let name: &mut String = cx.use_hook(|| "John Doe".to_string()); cx.render(rsx!( button { onclick: move |_| name.push_str("yes"), } button { onclick: move |_| name.push_str("no"), } ))
} Rust will not allow this to compile! We cannot Copy unique mutable references - they are, by definition, unique. However, we can reborrow our &mut T as an &T which are non-unique references and share those between handlers: fn example(cx: Scope) -> Element { let name: &String = &*cx.use_hook(|| "John Doe".to_string()); cx.render(rsx!( button { onclick: move |_| log::info!("{}", name), } button { onclick: move |_| log::info!("{}", name), } ))
} So, for any custom hook we want to design, we need to enable mutation through interior mutability - IE move to runtime borrow checking . We might incur a tiny runtime cost for each time we grab a new value from the hook, but this cost is extremely minimal. This example uses the Cell type to let us replace the value through interior mutability. Cell has practically zero overhead, but is slightly more limited that its RefCell cousin. fn example(cx: Scope) -> Element { let name: &Cell<&'static str> = cx.use_hook(|| Cell::new("John Doe")); cx.render(rsx!( button { onclick: move |_| name.set("John"), } button { onclick: move |_| name.set("Jane"), } ))
