Hooks like use_state and use_ref wrap this runtime borrow checking in a type that does implement Copy. Additionally, they also mark the component as "dirty" whenever a new value has been set. This way, whenever use_state has a new value set, the component knows to update. fn example(cx: Scope) -> Element { let name = use_state(&cx, || "Jack"); cx.render(rsx!( "Hello, {name}" button { onclick: move |_| name.set("John"), } button { onclick: move |_| name.set("Jane"), } ))
} Internally, our set function looks something like this: impl<'a, T> UseState<'a, T> { fn set(&self, new: T) { // Replace the value in the cell self.value.set(new); // Mark our component as dirty self.cx.needs_update(); }
} Most hooks we provide implement Deref on their values since they are essentially smart pointers. To access the underlying value, you'll often need to use the deref operator: fn example(cx: Scope) -> Element { let name = use_state(&cx, || "Jack"); match *name { "Jack" => {} "Jill" => {} _ => {} } // ..
}

