count += 1; Current value Our count value is more than just an integer. Because it's a smart pointer, it also implements other useful methods helpful in various contexts. For instance, we can get a handle to the current value at any time: let current: Rc<T> = count.current(); Or, we can get the inner handle to set the value: let setter: Rc<dyn Fn(T)> = count.setter(); Modify Or, we can set a new value using the current value as a reference: count.modify(|i| i + 1); with_mut and make_mut If the value is cheaply cloneable, then we can call with_mut to get a mutable reference to the value: count.with_mut(|i| *i += 1); Alternatively, we can call make_mut which gives us a RefMut to the underlying value: *count.make_mut() += 1; Use in Async Plus, the set_count handle is cloneable into async contexts, so we can use it in futures. // count up infinitely
